impl Solution {
    pub fn count_sub_multisets(nums: Vec<i32>, l: i32, r: i32) -> i32 {
        const MOD: i32 = 1_000_000_007;
        let max_sum: usize = nums.iter().sum::<i32>() as usize;
        let mut dp = vec![vec![0; max_sum + 1]; 2];
        dp[0][0] = 1;

        for &num in &nums {
            let (cur, prev) = if dp[0][0] == 1 { (1, 0) } else { (0, 1) };
            for j in 0..=max_sum {
                dp[cur][j] = dp[prev][j];
                if j as i32 >= num {
                    dp[cur][j] += dp[prev][j - num as usize];
                    dp[cur][j] %= MOD;
                }
            }
            dp[0][0] = 1;
        }

        let mut result = 0;
        for sum in l..=r {
            result = (result + dp[dp[0][0] as usize][sum as usize]) % MOD;
        }
        result
    }
}
